"use strict";(self.webpackChunkunityquest_chronicles_of_love=self.webpackChunkunityquest_chronicles_of_love||[]).push([[4206],{41994:(t,e,n)=>{n.r(e),n.d(e,{default:()=>i,johnChapter6PL:()=>r});const r={chapter:6,title:"Jean 6",version:"Gda\u0144sk Bible 1632",language:"pl",direction:"ltr",verses:[{number:1,text:"Potem odszed\u0142 Jezus za morze Galilejskie, kt\xf3re jest Tyberyadzkie.",strong:[]},{number:2,text:"I szed\u0142 za nim wielki lud, przeto \u017ce widzieli cuda jego, kt\xf3re czyni\u0142 nad chorymi.",strong:[{text:"foule",strong:"G3793",start:11,end:16}]},{number:3,text:"I wszed\u0142 Jezus na g\xf3r\u0119, i tam siedzia\u0142 z uczniami swymi.",strong:[{text:"montagne",strong:"G3735",start:19,end:27},{text:"avec",strong:"G1848",start:46,end:50}]},{number:4,text:"A by\u0142a blisko wielkanoc, \u015bwi\u0119to \u017bydowskie.",strong:[]},{number:5,text:"A podni\xf3s\u0142szy Jezus oczy, i ujrzawszy, \u017ce wielki lud szed\u0142 do niego, rzek\u0142 do Filipa: Gdzie\u017c nakupimy chleba, aby ci jedli?",strong:[{text:"foule",strong:"G3793",start:45,end:50},{text:"Philippe",strong:"G5376",start:77,end:85}]},{number:6,text:"(A to m\xf3wi\u0142, kusz\u0105c go; bo on wiedzia\u0142, co mia\u0142 czyni\u0107.)",strong:[{text:"faire",strong:"G1080",start:62,end:67}]},{number:7,text:"Odpowiedzia\u0142 mu Filip: Za dwie\u015bcie groszy chleba nie wystarczy im, aby ka\u017cdy z nich maluczko wzi\u0105\u0142.",strong:[{text:"Philippe",strong:"G5376",start:0,end:8},{text:"deux",strong:"G1417",start:51,end:55}]},{number:8,text:"Rzek\u0142 mu jeden z uczni\xf3w jego, Andrzej, brat Szymona Piotra:",strong:[]},{number:9,text:"Jest tu ch\u0142opiec jeden, kt\xf3ry ma pi\u0119\u0107 chleb\xf3w j\u0119czmiennych i dwie rybce; ale c\xf3\u017c to jest mi\u0119dzy tak wiele?",strong:[{text:"deux",strong:"G1417",start:54,end:58}]},{number:10,text:"Tedy rzek\u0142 Jezus: Ka\u017ccie si\u0119 ludziom posadzi\u0107. A by\u0142o wiele trawy na onem miejscu. I usiedli m\u0119\u017cowie liczbie oko\u0142o pi\u0119ciu tysi\u0119cy.",strong:[{text:"dans",strong:"H6887",start:42,end:46},{text:"beaucoup",strong:"G4183",start:55,end:63}]},{number:11,text:"I wzi\u0105\u0142 one chleby Jezus, a uczyniwszy dzi\u0119kczynienie, rozda\u0142 uczniom, a uczniowie siedz\u0105cym; tak\u017ce i z ryb, ile chcieli.",strong:[]},{number:12,text:"A gdy si\u0119 nasycili, rzek\u0142 uczniom swoim: Zbierajcie ostatki u\u0142omk\xf3w, aby nic nie zgin\u0119\u0142o.",strong:[{text:"rien",strong:"G3762",start:97,end:101}]},{number:13,text:"I pozbierali, a nape\u0142nili dwana\u015bcie kosz\xf3w u\u0142omkami z onych pi\u0119ciu chleb\xf3w j\u0119czmiennych, kt\xf3re zosta\u0142y po tych, kt\xf3rzy jedli.",strong:[{text:"avec",strong:"G1848",start:58,end:62}]},{number:14,text:"Tedy oni ludzie ujrzawszy on cud, kt\xf3ry uczyni\u0142 Jezus, m\xf3wili: Ten prawdziwie jest on prorok, kt\xf3ry mia\u0142 przyj\u015b\u0107 na \u015bwiat.",strong:[{text:"miracle",strong:"G1411",start:22,end:29},{text:"dans",strong:"H6887",start:111,end:115},{text:"monde",strong:"G2889",start:119,end:124}]},{number:15,text:"A Jezus poznawszy, \u017ce mieli przyj\u015b\u0107 i porwa\u0107 go, aby go uczynili kr\xf3lem, odszed\u0142 zasi\u0119 na g\xf3r\u0119 sam osobno.",strong:[{text:"faire",strong:"G1080",start:58,end:63},{text:"nouveau",strong:"G2537",start:82,end:89},{text:"montagne",strong:"G3735",start:97,end:105},{text:"seul",strong:"G3439",start:111,end:115}]},{number:16,text:"A gdy by\u0142o wiecz\xf3r, zst\u0105pili uczniowie jego nad morze.",strong:[]},{number:17,text:"A wsiad\u0142szy na \u0142\xf3d\u017a, jechali za morze do Kapernaum; a ju\u017c by\u0142a ciemno\u015b\u0107, a Jezus jeszcze nie by\u0142 przyszed\u0142 do nich.",strong:[{text:"dans",strong:"H6887",start:13,end:17},{text:"rendre",strong:"G1743",start:62,end:68}]},{number:18,text:"A morze si\u0119 wzdyma\u0142o od wiatru wielkiego, kt\xf3ry wia\u0142.",strong:[{text:"grand",strong:"G3173",start:16,end:21},{text:"vent",strong:"G4151",start:22,end:26}]},{number:19,text:"A up\u0142yn\u0105wszy oko\u0142o dwudziestu i pi\u0119ciu albo trzydziestu stajan, ujrzeli Jezusa chodz\u0105cego po morzu, i przybli\u017caj\u0105cego si\u0119 do \u0142odzi, i bali si\u0119.",strong:[{text:"avoir",strong:"G1372",start:6,end:11},{text:"peur",strong:"H3372",start:135,end:139}]},{number:20,text:"Ale on im rzek\u0142: Jam jest, nie b\xf3jcie si\u0119.",strong:[{text:"peur",strong:"H3372",start:43,end:47}]},{number:21,text:"Tedy go ch\u0119tliwie wzi\u0119li na \u0142\xf3d\u017a; a wnet przysta\u0142a \u0142\xf3d\u017a do ziemi, do kt\xf3rej p\u0142yn\u0119li.",strong:[{text:"prendre",strong:"G3880",start:22,end:29},{text:"dans",strong:"H6887",start:30,end:34}]},{number:22,text:"Nazajutrz lud, kt\xf3ry sta\u0142 za morzem, ujrzawszy, \u017ce tam nie by\u0142o innej \u0142odzi, jedno ona jedna, do kt\xf3rej byli wst\u0105pili uczniowie jego, a \u017ce Jezus nie by\u0142 wszed\u0142 z uczniami swymi na \u0142\xf3d\u017a, ale sami uczniowie jego odjechali;",strong:[{text:"foule",strong:"G3793",start:3,end:8},{text:"dans",strong:"H6887",start:143,end:147},{text:"cette",strong:"G3778",start:148,end:153},{text:"avec",strong:"G1848",start:161,end:165}]},{number:23,text:"(Aczkolwiek by\u0142y inne \u0142odzie przyp\u0142yn\u0119\u0142y z Tyberyady, blisko miejsca, gdzie jedli chleb, kt\xf3remu Pan dzi\u0119kowa\u0142;)",strong:[{text:"comme",strong:"G2531",start:14,end:19},{text:"pain",strong:"G740",start:104,end:108},{text:"Seigneur",strong:"G2962",start:122,end:130}]},{number:24,text:"Gdy tedy ujrza\u0142 lud, \u017ce tam nie by\u0142o Jezusa, ani uczni\xf3w jego, wsiedli i oni na \u0142odzie, i przyjechali do Kapernaum, szukaj\u0105c Jezusa.",strong:[{text:"foule",strong:"G3793",start:15,end:20},{text:"dans",strong:"H6887",start:95,end:99}]},{number:25,text:"A gdy go znale\u017ali za morzem, rzekli mu: Rabbi! kiedy tu przyszed\u0142?",strong:[]},{number:26,text:"Odpowiedzia\u0142 im Jezus i rzek\u0142: Zaprawd\u0119, zaprawd\u0119 powiadam wam: Szukacie mi\u0119, nie \u017ce widzieli\u015bcie cuda, ale \u017ce\u015bcie si\u0119 najedzli chleba, i nasycili\u015bcie si\u0119.",strong:[]},{number:27,text:"Pracujcie nie o pokarm, kt\xf3ry ginie, ale kt\xf3ry trwa ku \u017cywotowi wiecznemu, kt\xf3ry wam da Syn cz\u0142owieczy; bo tego zapiecz\u0119towa\u0142 B\xf3g Ojciec.",strong:[{text:"Fils",strong:"G5207",start:108,end:112},{text:"homme",strong:"G444",start:118,end:123},{text:"Dieu",strong:"G2316",start:169,end:173}]},{number:28,text:"Tedy rzekli do niego: C\xf3\u017c czyni\u0107 b\u0119dziemy, aby\u015bmy sprawowali sprawy Bo\u017ce?",strong:[{text:"faire",strong:"G1080",start:32,end:37},{text:"faire",strong:"G1080",start:44,end:49},{text:"Dieu",strong:"G2316",start:64,end:68}]},{number:29,text:"Odpowiedzia\u0142 Jezus i rzek\u0142 im: To\u0107 jest sprawa Bo\u017ca, aby\u015bcie wierzyli w onego, kt\xf3rego on pos\u0142a\u0142.",strong:[{text:"Dieu",strong:"G2316",start:32,end:36}]},{number:30,text:"Rzekli mu tedy: C\xf3\u017c ty za cud czynisz, \u017ceby\u015bmy widzieli i uwierzyli tobie? Co czynisz?",strong:[{text:"miracle",strong:"G1411",start:5,end:12}]},{number:31,text:"Ojcowie nasi jedli mann\u0119 na puszczy, jako napisano: Chleb z nieba da\u0142 im je\u015b\u0107.",strong:[{text:"dans",strong:"H6887",start:29,end:33},{text:"selon",strong:"G2531",start:45,end:50},{text:"pain",strong:"G740",start:86,end:90},{text:"ciel",strong:"H8064",start:94,end:98}]},{number:32,text:"Tedy im rzek\u0142 Jezus: Zaprawd\u0119, zaprawd\u0119 powiadam wam: Nie Moj\u017cesz da\u0142 wam chleb z nieba, ale Ojciec m\xf3j daje wam chleb prawdziwy z nieba.",strong:[{text:"pain",strong:"G740",start:83,end:87},{text:"ciel",strong:"H8064",start:91,end:95},{text:"pain",strong:"G740",start:130,end:134},{text:"ciel",strong:"H8064",start:138,end:142}]},{number:33,text:"Albowiem chleb Bo\u017cy jest ten, kt\xf3ry zst\u0119puje z nieba, a daje \u017cywot \u015bwiatu.",strong:[{text:"pain",strong:"G740",start:7,end:11},{text:"Dieu",strong:"G2316",start:15,end:19},{text:"ciel",strong:"H8064",start:48,end:52},{text:"monde",strong:"G2889",start:76,end:81}]},{number:34,text:"I rzekli do niego: Panie! dawaj nam zaw\u017cdy tego chleba.",strong:[{text:"Seigneur",strong:"G2962",start:16,end:24},{text:"toujours",strong:"H5769",start:37,end:45},{text:"pain",strong:"G740",start:49,end:53}]},{number:35,text:"Tedy im rzek\u0142 Jezus: Jam jest chleb \u017cywota; kto przychodzi do mnie, nie b\u0119dzie \u0142akn\u0105\u0142, a kto wierzy we mnie, nie b\u0119dzie pragn\u0105\u0142 nigdy.",strong:[{text:"pain",strong:"G740",start:27,end:31},{text:"soif",strong:"G1372",start:122,end:126}]},{number:36,text:"Ale rzek\u0142em wam, \u017ce\u015bcie mi\u0119 i widzieli, a nie wierzycie.",strong:[]},{number:37,text:"Wszystko, co mi daje Ojciec, do mnie przyjdzie, a tego, kt\xf3ry do mnie przychodzi, nie wyrzuc\u0119 precz.",strong:[]},{number:38,text:"Bom zst\u0105pi\u0142 z nieba, nie abym czyni\u0142 wol\u0119 moj\u0119, ale wol\u0119 onego, kt\xf3ry mi\u0119 pos\u0142a\u0142.",strong:[{text:"ciel",strong:"H8064",start:24,end:28},{text:"faire",strong:"G1080",start:34,end:39}]},{number:39,text:"A ta\u0107 jest wola Ojca, kt\xf3ry mi\u0119 pos\u0142a\u0142, abym nic nie utraci\u0142 ze wszystkiego, co mi da\u0142, ale \u017cebym to wzbudzi\u0142 w dzie\u0144 ostateczny.",strong:[{text:"rien",strong:"G3762",start:62,end:66},{text:"tout",strong:"G3956",start:70,end:74},{text:"jour",strong:"H3117",start:132,end:136}]},{number:40,text:"A ta\u0107 jest wola onego, kt\xf3ry mi\u0119 pos\u0142a\u0142, aby ka\u017cdy, kto widzi Syna, i wierzy we\u0144, mia\u0142 \u017cywot wieczny; a ja go wzbudz\u0119 w dzie\u0144 ostateczny.",strong:[{text:"Fils",strong:"G5207",start:52,end:56},{text:"jour",strong:"H3117",start:129,end:133}]},{number:41,text:"Tedy szemrali \u017bydowie przeciwko niemu, i\u017c powiedzia\u0142: Jam jest chleb, kt\xf3ry z nieba zst\u0105pi\u0142.",strong:[{text:"pain",strong:"G740",start:69,end:73},{text:"ciel",strong:"H8064",start:94,end:98}]},{number:42,text:"I m\xf3wili: Aza\u017c to nie jest Jezus, syn J\xf3zef\xf3w, kt\xf3rego my ojca i matk\u0119 znamy? jako\u017c tedy m\xf3wi ten: Z nieba zst\u0105pi\u0142em?",strong:[{text:"fils",strong:"G5207",start:43,end:47},{text:"ciel",strong:"H8064",start:142,end:146}]},{number:43,text:"Przeto\u017c odpowiedzia\u0142 Jezus i rzek\u0142 im: Nie szemrajcie mi\u0119dzy sob\u0105.",strong:[]},{number:44,text:"\u017baden nie mo\u017ce przyj\u015b\u0107 do mnie, je\u017ali go nie poci\u0105gnie Ojciec, kt\xf3ry mi\u0119 pos\u0142a\u0142; a ja go wzbudz\u0119 w dzie\u0144 ostateczny.",strong:[{text:"jour",strong:"H3117",start:98,end:102}]},{number:45,text:"Napisano jest w prorokach: I b\u0119d\u0105 wszyscy uczeni od Boga. Ka\u017cdy tedy, kt\xf3ry s\u0142ysza\u0142 od Ojca, i nauczy\u0142 si\u0119, przychodzi do mnie.",strong:[{text:"dans",strong:"H6887",start:13,end:17},{text:"Dieu",strong:"G2316",start:62,end:66}]},{number:46,text:"Nie \u017ce kto widzia\u0142 Ojca, tylko ten, kt\xf3ry jest od Boga, ten widzia\u0142 Ojca.",strong:[{text:"Dieu",strong:"G2316",start:55,end:59}]},{number:47,text:"Zaprawd\u0119, zaprawd\u0119 powiadam wam: Kto wierzy we mnie, ma \u017cywot wieczny.",strong:[]},{number:48,text:"Jam jest chleb \u017cywota.",strong:[{text:"pain",strong:"G740",start:11,end:15}]},{number:49,text:"Ojcowie wasi jedli mann\u0119 na puszczy, a pomarli.",strong:[{text:"dans",strong:"H6887",start:29,end:33}]},{number:50,text:"Tenci jest chleb, kt\xf3ry z nieba zst\u0119puje, aby kto z niego jad\u0142, nie umar\u0142.",strong:[{text:"pain",strong:"G740",start:13,end:17},{text:"ciel",strong:"H8064",start:33,end:37}]},{number:51,text:"Jam jest chleb \u017cywy, kt\xf3rym z nieba zst\u0105pi\u0142; je\u017aliby kto jad\u0142 z tego chleba, \u017cy\u0107 b\u0119dzie na wieki; a chleb, kt\xf3ry ja dam, cia\u0142o moje jest, kt\xf3re ja dam za \u017cywot \u015bwiata.",strong:[{text:"pain",strong:"G740",start:11,end:15},{text:"ciel",strong:"H8064",start:43,end:47},{text:"pain",strong:"G740",start:74,end:78},{text:"pain",strong:"G740",start:110,end:114},{text:"chair",strong:"G4561",start:141,end:146},{text:"monde",strong:"G2889",start:179,end:184}]},{number:52,text:"Sprzeczali si\u0119 tedy \u017bydowie mi\u0119dzy sob\u0105, m\xf3wi\u0105c: Jako\u017c nam ten mo\u017ce da\u0107 cia\u0142o swoje do jedzenia?",strong:[{text:"donner",strong:"G1325",start:73,end:79},{text:"chair",strong:"G4561",start:83,end:88}]},{number:53,text:"Tedy im rzek\u0142 Jezus: Zaprawd\u0119, zaprawd\u0119 powiadam wam: Je\u017ali nie b\u0119dziecie jedli cia\u0142a Syna cz\u0142owieczego, a nie b\u0119dziecie pili krwi jego, nie b\u0119dziecie mieli \u017cywota w sobie.",strong:[{text:"chair",strong:"G4561",start:75,end:80},{text:"Fils",strong:"G5207",start:84,end:88},{text:"homme",strong:"G444",start:94,end:99}]},{number:54,text:"Kto po\u017cywa cia\u0142a mego, a pije krwi mojej, ma \u017cywot wieczny, a ja go wzbudz\u0119 w dzie\u0144 ostateczny.",strong:[{text:"chair",strong:"G4561",start:19,end:24},{text:"jour",strong:"H3117",start:100,end:104}]},{number:55,text:"Albowiem cia\u0142o moje prawdziwie jest pokarm, a krew moja prawdziwie jest nap\xf3j.",strong:[{text:"chair",strong:"G4561",start:7,end:12}]},{number:56,text:"Kto po\u017cywa cia\u0142a mego, a pije krwi mojej, we mnie mieszka, a ja w nim.",strong:[{text:"chair",strong:"G4561",start:19,end:24},{text:"demeure",strong:"H1004",start:46,end:53},{text:"demeure",strong:"H1004",start:68,end:75}]},{number:57,text:"Jako mi\u0119 pos\u0142a\u0142 \u017cywy Ojciec, a ja \u017cyj\u0119 dla Ojca, tak kto mi\u0119 po\u017cywa, i on \u017cy\u0107 b\u0119dzie dla mnie.",strong:[{text:"Comme",strong:"G2531",start:0,end:5}]},{number:58,text:"Tenci jest on chleb, kt\xf3ry z nieba zst\u0105pi\u0142; nie jako ojcowie wasi jedli mann\u0119, i pomarli; kto po\u017cywa tego chleba, \u017cy\u0107 b\u0119dzie na wieki.",strong:[{text:"pain",strong:"G740",start:13,end:17},{text:"ciel",strong:"H8064",start:38,end:42},{text:"comme",strong:"G2531",start:60,end:65},{text:"pain",strong:"G740",start:140,end:144}]},{number:59,text:"To powiedzia\u0142 w szkole, nauczaj\u0105c w Kapernaum.",strong:[{text:"dans",strong:"H6887",start:21,end:25},{text:"enseignant",strong:"G1320",start:40,end:50}]},{number:60,text:"Przeto\u017c wiele z uczni\xf3w jego us\u0142yszawszy, m\xf3wili: Twarda jest ta mowa; kt\xf3\u017c jej mo\u017ce s\u0142ucha\u0107?",strong:[{text:"avoir",strong:"G1372",start:36,end:41},{text:"Cette",strong:"G3778",start:59,end:64},{text:"parole",strong:"G3056",start:65,end:71}]},{number:61,text:"Ale Jezus wiedz\u0105c sam w sobie, i\u017c narzekali na to uczniowie jego, rzek\u0142 im: To was gorszy?",strong:[]},{number:62,text:"C\xf3\u017c tedy, ujrzycie li Syna cz\u0142owieczego wst\u0119puj\u0105cego tam, gdzie by\u0142 pierwej?",strong:[{text:"Fils",strong:"G5207",start:20,end:24},{text:"homme",strong:"G444",start:30,end:35}]},{number:63,text:"Duch jest, kt\xf3ry o\u017cywia, a cia\u0142o nic nie po\u017cytkuje; s\u0142owa, kt\xf3re ja wam m\xf3wi\u0119, duchem i \u017cywotem s\u0105.",strong:[{text:"esprit",strong:"G4151",start:8,end:14},{text:"chair",strong:"G4561",start:31,end:36},{text:"rien",strong:"G3762",start:48,end:52},{text:"esprit",strong:"G4151",start:92,end:98}]},{number:64,text:"Ale s\u0105 niekt\xf3rzy z was, kt\xf3rzy nie wierz\u0105. (Albowiem wiedzia\u0142 Jezus od pocz\u0105tku, kt\xf3rzy s\u0105, co nie wierz\u0105, i kto jest, kt\xf3ry go zdradzi.)",strong:[{text:"commencement",strong:"G746",start:85,end:97}]},{number:65,text:"I m\xf3wi\u0142: Przeto\u017cem wam powiedzia\u0142, i\u017c \u017caden nie mo\u017ce przyj\u015b\u0107 do mnie, je\u017aliby mu to nie by\u0142o dano od Ojca mego.",strong:[]},{number:66,text:"Od tego czasu wiele uczni\xf3w jego odesz\u0142o wstecz, i ju\u017c z nim nie chodzili.",strong:[{text:"avec",strong:"G1848",start:80,end:84}]},{number:67,text:"Tedy rzek\u0142 Jezus do onych dwunastu: Aza\u017c i wy chcecie odej\u015b\u0107?",strong:[{text:"aller",strong:"G4198",start:68,end:73}]},{number:68,text:"Odpowiedzia\u0142 mu Szymon Piotr: Panie! do kogo\u017c p\xf3jdziemy? S\u0142owa \u017cywota wiecznego masz.",strong:[{text:"Seigneur",strong:"G2962",start:27,end:35}]},{number:69,text:"A my\u015bmy uwierzyli i poznali, \u017ce\u015b ty jest Chrystus, Syn Boga \u017cywego.",strong:[{text:"Christ",strong:"G5547",start:51,end:57},{text:"Dieu",strong:"G2316",start:71,end:75}]},{number:70,text:"Odpowiedzia\u0142 im Jezus: Aza\u017cem ja was dwunastu nie obra\u0142? wszak\u017ce z was jeden jest diabel.",strong:[]},{number:71,text:"A to m\xf3wi\u0142 o Judaszu Szymona Iskaryjotczyka; bo ten go mia\u0142 zdradzi\u0107, b\u0119d\u0105c jeden z dwunastu.",strong:[{text:"fils",strong:"G5207",start:30,end:34}]}]},i=r}}]);
//# sourceMappingURL=john-john-06-pl-js.613fd73a.chunk.js.map